mapper.select:

select 

from jvd_record_master
where KYORI = #{kyori,jdbcType=DECIMAL}
  and KYOSO_SHUBETSU_CODE = #{kyosoShubetsuCode,jdbcType=CHAR}
  and RACE_CODE = #{raceCode,jdbcType=CHAR}
  and RECORD_SHIKIBETSU_KUBUN = #{recordShikibetsuKubun,jdbcType=CHAR}
  and TOKUBETSU_KYOSO_BANGO = #{tokubetsuKyosoBango,jdbcType=CHAR}
  and TRACK_CODE = #{trackCode,jdbcType=CHAR}

mapper.delete:

delete from jvd_record_master
where KYORI = #{kyori,jdbcType=DECIMAL}
  and KYOSO_SHUBETSU_CODE = #{kyosoShubetsuCode,jdbcType=CHAR}
  and RACE_CODE = #{raceCode,jdbcType=CHAR}
  and RECORD_SHIKIBETSU_KUBUN = #{recordShikibetsuKubun,jdbcType=CHAR}
  and TOKUBETSU_KYOSO_BANGO = #{tokubetsuKyosoBango,jdbcType=CHAR}
  and TRACK_CODE = #{trackCode,jdbcType=CHAR}
